import React from 'react'


    const ItemCard = (props) => {
        console.log("props in item card: ", props.item.name)
        let item = props.item
        return (
          <tr>
            <td>{item.name}</td>
            <td>{item.sku}</td>
            <td>{item.color}</td>
            <td>{item.price}</td>
            <td>{item.sale_price}</td>
            <td>{item.onhand_qty}</td>
            <td>{item.comingin_qty}</td>

          </tr>
        )
      }

export default ItemCard

